</td>\n            <td></td>\n            <td>11500 + 2200 + 2050 + 1950 + 1800 + 1700 + 8000 + 7500 + 14000 + ((AREA-3000) * 12)</td>\n        </tr>\n    \n</table>', 'range', NULL, NULL, NULL, '[[to:500.00,value:\"AREA * 23\",from:0],[to:600.00,value:\"11500 + ((AREA-500) * 22)\",from:500.00],[to:700.00,value:\"11500 + 2200 + ((AREA-600) * 20.50)\",from:600.00],[to:800.00,value:\"11500 + 2200 + 2050 + ((AREA-700) * 19.50)\",from:700.00],[to:900.00,value:\"11500 + 2200 + 2050 + 1950 + ((AREA-800) * 18)\",from:800.00],[to:1000.00,value:\"11500 + 2200 + 2050 + 1950 + 1800 + ((AREA-900) * 17)\",from:900.00],[to:1500.00,value:\"11500 + 2200 + 2050 + 1950 + 1800 + 1700 + ((AREA-1000) * 16)\",from:1000.00],[to:2000.00,value:\"11500 + 2200 + 2050 + 1950 + 1800 + 1700 + 8000 + ((AREA-1500) * 15)\",from:1500.00],[to:3000.00,value:\"11500 + 2200 + 2050 + 1950 + 1800 + 1700 + 8000 + 7500 + ((AREA-2000) * 14)\",from:2000.00],[value:\"11500 + 2200 + 2050 + 1950 + 1800 + 1700 + 8000 + 7500 + 14000 + ((AREA-3000) * 12)\",from:3000.00]]', NULL, 1);
